import React from "react";
import styled from "styled-components";

let Section = styled.section`
	width: 60%;
	margin: 80px auto 0px auto;
`;

let Title = styled.h1`
	font-size: 3rem;
	color: white;
	font-family: "Quicksand", sans-serif;
`;

let Paragraph = styled.p`
	font-size: 1rem;
`;

function Jumbotron() {
	return (
		<Section>
			<Title>
				You love your pets, <br /> so do we.
			</Title>
			<Paragraph>
				At Sit.com we provide the most quality caretakers <br />
				to your beloved pets
			</Paragraph>
		</Section>
	);
}

export default Jumbotron;
